import React from 'react';
import { Button } from 'antd';
import styled from 'styled-components';


const DetailPost = ({ onClose, post}) => {
    return (
        <>
        <Button  style={{width: '100%'}} onClick={onClose}>닫기</Button>
        <div>{post.title}</div>
        </>
        
    );
};

export default DetailPost;
